import React, { useState } from 'react';

const Odontograma = ({ data = [], onUpdate }) => {
  const [activeTooth, setActiveTooth] = useState(null);
  const [formData, setFormData] = useState({
    estado: 'sano',
    tratamiento: '',
    notas: ''
  });

  const toothStates = [
    { value: 'sano', label: 'Sano', color: 'bg-white' },
    { value: 'caries', label: 'Caries', color: 'bg-yellow-300' },
    { value: 'obturado', label: 'Obturado', color: 'bg-blue-300' },
    { value: 'extraido', label: 'ExtraÃ­do', color: 'bg-gray-300' },
    { value: 'endodoncia', label: 'Endodoncia', color: 'bg-purple-300' },
    { value: 'corona', label: 'Corona', color: 'bg-green-300' },
    { value: 'implante', label: 'Implante', color: 'bg-red-300' }
  ];

  const handleToothClick = (tooth) => {
    if (!tooth) return;
    setActiveTooth(tooth);
    setFormData({
      estado: tooth.estado || 'sano',
      tratamiento: tooth.tratamiento || '',
      notas: tooth.notas || ''
    });
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const saveChanges = () => {
    const updatedData = data.map(tooth =>
      tooth.numero === activeTooth.numero
        ? { ...tooth, ...formData }
        : tooth
    );
    onUpdate(updatedData);
    setActiveTooth(null);
  };

  const getToothColor = (state) => {
    const stateObj = toothStates.find(s => s.value === state);
    return stateObj ? stateObj.color : 'bg-white';
  };

  if (!Array.isArray(data)) {
    return <div className="p-4 bg-white rounded shadow">Odontograma no disponible</div>;
  }

  return (
    <div>
      <div className="mb-6">
        <div className="grid grid-cols-8 gap-2 mb-2">
          {Array.from({ length: 16 }).map((_, i) => {
            const tooth = data.find(t => t.numero === i + 1);
            return (
              <div
                key={`upper-${i}`}
                onClick={() => handleToothClick(tooth)}
                className={`h-10 border border-gray-300 rounded-t-full flex items-center justify-center cursor-pointer transition-colors ${
                  getToothColor(tooth?.estado)
                } ${activeTooth?.numero === tooth?.numero ? 'ring-2 ring-blue-500' : ''}`}
              >
                {i + 1}
              </div>
            );
          })}
        </div>
        <div className="grid grid-cols-8 gap-2">
          {Array.from({ length: 16 }).map((_, i) => {
            const tooth = data.find(t => t.numero === i + 17);
            return (
              <div
                key={`lower-${i}`}
                onClick={() => handleToothClick(tooth)}
                className={`h-10 border border-gray-300 rounded-b-full flex items-center justify-center cursor-pointer transition-colors ${
                  getToothColor(tooth?.estado)
                } ${activeTooth?.numero === tooth?.numero ? 'ring-2 ring-blue-500' : ''}`}
              >
                {i + 17}
              </div>
            );
          })}
        </div>
      </div>

      {activeTooth && (
        <div className="bg-gray-50 p-4 rounded-lg">
          <h4 className="font-medium mb-4">Pieza Dental #{activeTooth.numero}</h4>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-4">
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Estado</label>
              <select
                name="estado"
                value={formData.estado}
                onChange={handleChange}
                className="w-full px-3 py-2 border border-gray-300 rounded"
              >
                {toothStates.map(state => (
                  <option key={state.value} value={state.value}>
                    {state.label}
                  </option>
                ))}
              </select>
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Tratamiento</label>
              <input
                type="text"
                name="tratamiento"
                value={formData.tratamiento}
                onChange={handleChange}
                className="w-full px-3 py-2 border border-gray-300 rounded"
                placeholder="Ej: ObturaciÃ³n clase II"
              />
            </div>
          </div>

          <div className="mb-4">
            <label className="block text-sm font-medium text-gray-700 mb-1">Notas</label>
            <textarea
              name="notas"
              value={formData.notas}
              onChange={handleChange}
              className="w-full px-3 py-2 border border-gray-300 rounded"
              rows="3"
              placeholder="Detalles sobre la pieza dental..."
            />
          </div>

          <div className="flex justify-end space-x-2">
            <button
              onClick={() => setActiveTooth(null)}
              className="px-4 py-2 border border-gray-300 rounded text-gray-700 hover:bg-gray-50"
            >
              Cancelar
            </button>
            <button
              onClick={saveChanges}
              className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700"
            >
              Guardar Cambios
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Odontograma;
